package elementaryAlgorithm;

import java.util.ArrayList;
import java.util.List;

/**
 * @功能职责:
 * 给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的字母异位词。
 *
 * 注意：若 s 和 t 中每个字符出现的次数都相同，则称 s 和 t 互为字母异位词。
 *
 *  
 *
 * 示例 1:
 *
 * 输入: s = "anagram", t = "nagaram"
 * 输出: true
 * 示例 2:
 *
 * 输入: s = "rat", t = "car"
 * 输出: false
 *  
 *
 * 提示:
 *
 * 1 <= s.length, t.length <= 5 * 104
 * s 和 t 仅包含小写字母
 *  
 *
 * 进阶: 如果输入字符串包含 unicode 字符怎么办？你能否调整你的解法来应对这种情况？
 *
 * 作者：力扣 (LeetCode)
 * 链接：https://leetcode-cn.com/leetbook/read/top-interview-questions-easy/xn96us/
 * 来源：力扣（LeetCode）
 * 著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。
 * @描述：
 * @作者: 郭辉
 * @创建时间: 2020-12-02
 * @copyright Copyright (c) 2020 中国软件与技术服务股份有限公司
 * @company 中国软件与技术服务股份有限公司
 */
public class ValidLetterEctopicWords {

    public boolean isAnagram(String s, String t) {
        List<Integer> sL = tract(s);
        List<Integer> tL = tract(t);
        for (int i = 0; i < 26; i++) {
           /* System.out.println(sL.get(i));
            System.out.println(tL.get(i));
            System.out.println(sL.get(i) != tL.get(i));*/
            if (!sL.get(i).toString().equals(tL.get(i).toString())){
                return false;
            }
        }
        return true;
    }

    public static List<Integer> tract(String pam){
        List<Integer> list = new ArrayList<>(26);
        for (int i = 0; i < 26; i++) {
            list.add(0);
        }
        char[] chars = pam.toCharArray();
        for (int i = 0; i < chars.length; i++) {
            list.set(chars[i]%'a',list.get(chars[i]%'a')+1);
        }
        return list;
    }

    public static void main(String[] args) {
        ValidLetterEctopicWords validLetterEctopicWords = new ValidLetterEctopicWords();
        System.out.println(validLetterEctopicWords.isAnagram("",
                ""));
    }
}
